import React, {useState} from 'react';
import axios from 'axios';
import {useNavigate} from 'react-router-dom';

const LoginForm = () => {
    const navigate = useNavigate();
    const [formData, setFormData] = useState({email: '', password: ''});

    const handleChange = (e) => {
        const {name, value} = e.target;
        setFormData((prev) => ({...prev, [name]: value}));
    };

    const handleSubmit = async (e) => {
        e.preventDefault();
        try {
            await axios.post('http://localhost:8080/api/member/login', formData, {
                withCredentials: true,
            });
            alert('로그인 성공!');
            navigate('/');
        } catch (error) {
            alert('로그인 실패!');
            console.error(error);
        }
    };

    return (
        <div className="w-1/2 flex flex-col justify-center items-center">
            <div className="w-96 relative inline-flex flex-col justify-start items-start gap-12">
                <div className="flex flex-col justify-start items-start gap-7">
                    <div className="text-center justify-center">
                        <span className="text-font text-4xl font-bold font-sans leading-9 tracking-tight">환영합니다 </span>
                        <span className="text-font text-4xl font-normal font-sans leading-9 tracking-tight"> 👋</span>
                    </div>
                    <div className="justify-center"><span
                        className="text-slate-700 text-xl font-bold font-sans leading-loose tracking-tight">오늘, 당신의 재능이 연결되는 순간.<br/></span><span
                        className="text-slate-700 text-base font-medium font-sans leading-relaxed tracking-tight">일상에 쉼을, 재능에 가치를, 사람에 철학을 잇는 ITDA와 함께지금 로그인하고 당신의 이야기를 시작하세요.</span>
                    </div>
                </div>
                <div className="self-stretch flex flex-col justify-center items-end gap-6">
                    <div data-type="Desktop" className="self-stretch flex flex-col justify-start items-start gap-2">
                        <div
                            className="justify-center text-font text-base font-normal font-['Roboto'] leading-none tracking-tight">Email
                        </div>
                        <div className="w-96 h-12 bg-slate-50 rounded-xl outline outline-1 outline-gray-300"/>
                        <div
                            className="justify-center text-slate-400 text-base font-normal font-['Roboto'] leading-none tracking-tight">Example@email.com
                        </div>
                    </div>
                    <div data-type="Desktop" className="self-stretch flex flex-col justify-start items-start gap-2">
                        <div
                            className="justify-center text-font text-base font-normal font-['Roboto'] leading-none tracking-tight">Password
                        </div>
                        <div className="w-96 h-12 bg-slate-50 rounded-xl outline outline-1 outline-gray-300"/>
                        <div
                            className="justify-center text-slate-400 text-base font-normal font-['Roboto'] leading-none tracking-tight">비밀번호
                        </div>
                    </div>
                    <div
                        className="text-center justify-center text-blue-700 text-base font-normal font-['Roboto'] leading-none tracking-tight">
                        Forgot Password?
                    </div>
                    <div data-type="Desktop"
                         className="self-stretch py-4 bg-slate-800 rounded-xl inline-flex justify-between items-center">
                        <div
                            className="text-center justify-center text-white text-xl font-normal font-['Roboto'] leading-tight tracking-tight">
                            Sign in
                        </div>
                    </div>
                </div>
                <div className="flex flex-col justify-start items-start gap-6">
                    <div className="w-96 py-2.5 inline-flex justify-center items-center gap-4">
                        <div className="flex-1 h-0 outline outline-1 outline-offset-[-0.50px] outline-slate-300"></div>
                        <div
                            className="text-center justify-center text-slate-700 text-base font-normal font-['Roboto'] leading-none tracking-tight">Or
                        </div>
                        <div className="flex-1 h-0 outline outline-1 outline-offset-[-0.50px] outline-slate-300"></div>
                    </div>
                    <div className="w-96 flex flex-col justify-center items-center gap-4">
                        <img className="w-96 h-14" src="https://placehold.co/367x55"/>
                    </div>
                </div>
                <div className="w-96 text-center justify-center"><span
                    className="text-slate-700 text-lg font-normal font-['Roboto'] leading-7 tracking-tight">계정이 없으신가요? </span><span
                    className="text-blue-700 text-lg font-normal font-['Roboto'] leading-7 tracking-tight">회원가입</span>
                </div>
                <div
                    className="w-96 left-0 top-[856px] absolute text-center justify-center text-slate-400 text-base font-normal font-['Roboto'] leading-none tracking-tight">©
                    2025 ITDA
                </div>
            </div>


            {/*<div className="w-full max-w-sm space-y-6">*/}
            {/*    <h2 className="text-2xl font-bold text-left">환영합니다 👋</h2>*/}
            {/*    <p className="text-sm text-gray-500">당신의 재능이 이어지는 시작, ITDA</p>*/}

            {/*    <input type="text" placeholder="아이디" className="w-full px-4 py-2 border rounded" />*/}
            {/*    <input type="password" placeholder="비밀번호" className="w-full px-4 py-2 border rounded" />*/}

            {/*

            {/*    <div className="text-sm text-center text-gray-500">*/}
            {/*        계정이 없으신가요? <a href="/join" className="text-indigo-600 font-medium hover:underline">회원가입</a>*/}
            {/*    </div>*/}
            {/*</div>*/}
        </div>
    );
};

export default LoginForm;
